        <Link to="/countries" className="exp">
          Explorar
        </Link>
      </Intro>
    </HomeContainer>
  );
}

const HomeContainer = styled.main`
margin-top:20rem;
  height: 30rem;
  background-color: #fff;

  h1 {
    color: #43597D;
